import React, { useContext} from 'react';
import { AuthContext } from '../contexts/AuthProvider';

const UserCarts = () => {
    const { user } = useContext(AuthContext)
    console.log('Carts Data',  user.carts)
    return (
        <div>
            {
            user && user.carts.length > 0 &&
            user.carts.map(cart => (
                <p>{cart.id}</p>
            ))
            }
        </div>
    )
}

export default UserCarts;
